CREATE TABLE `corporate_agents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `emp_id` varchar(20) NOT NULL,
  `email` varchar(60) NOT NULL,
  `contact_no` varchar(15) DEFAULT NULL,
  `user_name` varchar(60) NOT NULL,
  `password` varchar(100) NOT NULL,
  `old_password` varchar(100) DEFAULT NULL,
  `profile_image` varchar(500) DEFAULT NULL,
  `has_radio_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_local_booking_access` tinyint(4) NOT NULL DEFAULT '0',
  `has_outstation_booking_access` tinyint(4) NOT NULL DEFAULT '0',
  `has_bus_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_train_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_hotel_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_flight_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_meal_booking_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_water_bottles_booking_access` tinyint(4) NOT NULL DEFAULT '0',
  `has_reverse_logistics_booking_access` tinyint(4) NOT NULL DEFAULT '0',
  `has_billing_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_voucher_payment_access` tinyint(1) NOT NULL DEFAULT '0',
  `has_voucher_approval_access` tinyint(1) NOT NULL DEFAULT '0',
  `is_super_admin` tinyint(1) NOT NULL DEFAULT '0',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '1-Active,0-DeActive',
  `last_login` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=latin1;
