/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `corporate_group_authenticator` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `group_id` int(11) NOT NULL,
  `corporate_id` int(11) NOT NULL,
  `cid` varchar(20) DEFAULT NULL,
  `name` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `contact_no` varchar(15) DEFAULT NULL,
  `password` varchar(100) NOT NULL,
  `old_password` varchar(100) DEFAULT NULL,
  `profile_image` varchar(500) DEFAULT NULL,
  `is_radio` tinyint(4) NOT NULL DEFAULT '1',
  `is_local` tinyint(4) NOT NULL DEFAULT '1',
  `is_outstation` tinyint(4) NOT NULL DEFAULT '0',
  `is_bus` tinyint(4) NOT NULL DEFAULT '1',
  `is_train` tinyint(4) NOT NULL DEFAULT '1',
  `is_hotel` tinyint(4) NOT NULL DEFAULT '1',
  `is_meal` tinyint(4) NOT NULL DEFAULT '0',
  `is_flight` tinyint(4) NOT NULL DEFAULT '1',
  `is_water_bottles` tinyint(4) NOT NULL DEFAULT '1',
  `is_reverse_logistics` tinyint(4) NOT NULL DEFAULT '1',
  `access_token` varchar(60) NOT NULL,
  `device_id` varchar(50) DEFAULT NULL,
  `fcm_regid` varchar(300) DEFAULT NULL,
  `last_login` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `is_deleted` int(11) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=latin1;
