CREATE TABLE `corporate_spocs_action_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `access_token` varchar(60) DEFAULT NULL,
  `corporate_id` int(11) NOT NULL,
  `group_id` int(11) NOT NULL DEFAULT '0',
  `subgroup_id` int(11) NOT NULL DEFAULT '0',
  `user_cid` varchar(20) DEFAULT NULL,
  `user_name` varchar(30) NOT NULL,
  `user_contact` varchar(50) DEFAULT NULL,
  `email` varchar(200) NOT NULL,
  `username` varchar(50) NOT NULL,
  `password` varchar(100) NOT NULL,
  `old_password` varchar(100) DEFAULT NULL,
  `profile_image` varchar(500) DEFAULT NULL,
  `budget` float NOT NULL DEFAULT '0',
  `expense` float NOT NULL DEFAULT '0',
  `is_radio` tinyint(1) NOT NULL DEFAULT '0',
  `is_local` tinyint(4) NOT NULL DEFAULT '0',
  `is_outstation` tinyint(1) NOT NULL DEFAULT '0',
  `is_bus` tinyint(1) NOT NULL DEFAULT '1',
  `is_train` tinyint(1) NOT NULL DEFAULT '1',
  `is_hotel` tinyint(1) NOT NULL DEFAULT '1',
  `is_meal` tinyint(1) NOT NULL DEFAULT '0',
  `is_flight` tinyint(1) NOT NULL DEFAULT '1',
  `is_water_bottles` tinyint(4) DEFAULT '0',
  `is_reverse_logistics` tinyint(4) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0-Deactive, 1-Active, 2-Deactive amd employees taken',
  `has_single_employee` tinyint(1) NOT NULL DEFAULT '0',
  `fcm_regid` varchar(200) DEFAULT NULL,
  `last_login` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `spoc_id` int(11) NOT NULL,
  `user_type` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `action_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `action` varchar(60) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=latin1;
