@full_error;
      ROLLBACK;
    END;
    
    START TRANSACTION;
    INSERT INTO bus_bookings(pickup_location,drop_location,bus_type_priority_1,bus_type_priority_2,bus_type_priority_3,booking_datetime,pickup_from_datetime,preferred_bus,no_of_seats,reason_booking,billing_entity_id,corporate_id,spoc_id,group_id,subgroup_id,assessment_code,assessment_city_id) 
VALUES (from_location,to_location,bus_type_1,bus_type_2,bus_type_3,booking_datetime,journey_datetime,preferred_bus,no_of_seats,reason_booking,billing_entity_id,corporate_id,spoc_id,group_id,subgroup_id,assessment_code,assessment_city_id);
    
    SET gen_booking_id = LAST_INSERT_ID();
    
    UPDATE bus_bookings SET reference_no = CONCAT('TV',(SELECT corporate_code FROM corporates WHERE id = corporate_id),gen_booking_id) WHERE id = gen_booking_id;
    
    INSERT INTO bus_bookings_action_log(booking_id,action,action_date,user_id,user_type) VALUES(gen_booking_id,1,NOW(),user_id,login_type);
    
    
iterator:
LOOP
  IF LENGTH(TRIM(employees)) = 0 OR employees IS NULL THEN
    LEAVE iterator;
  END IF;
  SET _next = SUBSTRING_INDEX(employees,',',1);
  SET _nextlen = LENGTH(_next);
  SET _value = TRIM(_next);

  INSERT INTO employee_bus_booking (bus_booking_id,employee_id) VALUES (gen_booking_id,_value);
  SET employees = INSERT(employees,1,_nextlen + 1,'');
END LOOP;
    
    
    
    IF login_type = 10 THEN
    
  UPDATE bus_bookings SET status_client=7,status_cotrav=1 WHERE id = gen_booking_id;
    
    ELSE
    
    IF(SELECT has_auth_level from corporates where id = corporate_id) = 1 THEN
IF (SELECT no_of_auth_level from corporates where id = corporate_id) = 1 THEN
    UPDATE bus_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
