     UPDATE bus_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
    END IF;
ELSE
UPDATE bus_bookings SET status_client=7,status_cotrav=1 WHERE id = gen_booking_id;
SELECT * FROM corporates WHERE id = 0;
END IF;

END IF;

    COMMIT;
END ;;
