    NO SQL
BEGIN

    DECLARE gen_booking_id INT DEFAULT 0;
    DECLARE _next TEXT DEFAULT NULL;
DECLARE _nextlen INT DEFAULT NULL;
DECLARE _value TEXT DEFAULT NULL;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    
    BEGIN
       GET DIAGNOSTICS CONDITION 1 
@sqlstate = RETURNED_SQLSTATE, 
   
@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
  SET 
@full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
  SELECT 
@full_error;
      ROLLBACK;
    END;
    
    START TRANSACTION;
    INSERT INTO flight_bookings(usage_type,journey_type,flight_class,from_location,to_location,booking_datetime,departure_datetime,preferred_flight,assessment_code,no_of_seats,group_id,subgroup_id,spoc_id,corporate_id,billing_entity_id,reason_booking) 
VALUES (usage_type,journey_type,flight_class,from_location,to_location,booking_datetime,departure_datetime,preferred_flight,assessment_code,no_of_seats,group_id,subgroup_id,spoc_id,corporate_id,billing_entity_id,reason_booking);
    
    SET gen_booking_id = LAST_INSERT_ID();
    
    UPDATE flight_bookings SET reference_no = CONCAT('TV',(SELECT corporate_code FROM corporates WHERE id = corporate_id),gen_booking_id) WHERE id = gen_booking_id;
    
    INSERT INTO flight_bookings_action_log(booking_id,action,action_date,user_id,user_type) VALUES(gen_booking_id,1,NOW(),user_id,user_type);
    
    
iterator:
LOOP
  IF LENGTH(TRIM(employees)) = 0 OR employees IS NULL THEN
    LEAVE iterator;
  END IF;
  SET _next = SUBSTRING_INDEX(employees,',',1);
  SET _nextlen = LENGTH(_next);
  SET _value = TRIM(_next);

  INSERT INTO employee_flight_booking (flight_booking_id,employee_id) VALUES (gen_booking_id,_value);
  SET employees = INSERT(employees,1,_nextlen + 1,'');
END LOOP;
    
    
    
    
    IF user_type = 10 THEN
    
  UPDATE flight_bookings SET status_client=7,status_cotrav=1 WHERE id = gen_booking_id;
    
    ELSE
    
    IF(SELECT has_auth_level from corporates where id = corporate_id) = 1 THEN
IF (SELECT no_of_auth_level from corporates where id = corporate_id) = 1 THEN
    UPDATE flight_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
    ELSE
     UPDATE flight_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
    END IF;
