CREATE DEFINER=`root`@`localhost` PROCEDURE `addTrainBooking`(IN `login_type` INT, IN `user_id` INT, IN `corporate_id` INT, IN `spoc_id` INT, IN `group_id` INT, IN `subgroup_id` INT, IN `from_location` VARCHAR(250), IN `to_location` VARCHAR(250), IN `train_type_1` INT, IN `train_type_3` INT, IN `train_type_2` INT, IN `booking_datetime` DATETIME, IN `journey_datetime` DATETIME, IN `billing_entity_id` INT, IN `preferred_train` VARCHAR(250), IN `reason_booking` VARCHAR(200), IN `no_of_seats` INT, IN `assessment_code` INT, IN `assessment_city_id` INT, IN `employees` VARCHAR(100))
    NO SQL
BEGIN

    DECLARE gen_booking_id INT DEFAULT 0;
    DECLARE _next TEXT DEFAULT NULL;
DECLARE _nextlen INT DEFAULT NULL;
DECLARE _value TEXT DEFAULT NULL;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
       GET DIAGNOSTICS CONDITION 1 
@sqlstate = RETURNED_SQLSTATE, 
   
@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
  SET 
@full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
  SELECT 
@full_error;
      ROLLBACK;
    END;
    
    START TRANSACTION;
    INSERT INTO train_bookings(pickup_location,drop_location,train_type_priority_1,train_type_priority_2,train_type_priority_3,booking_datetime,pickup_from_datetime,preferred_train,no_of_seats,reason_booking,billing_entity_id,corporate_id,spoc_id,group_id,subgroup_id,assessment_code,assessment_city_id) 
VALUES (from_location,to_location,train_type_1,train_type_2,train_type_3,booking_datetime,journey_datetime,preferred_train,no_of_seats,reason_booking,billing_entity_id,corporate_id,spoc_id,group_id,subgroup_id,assessment_code,assessment_city_id);
    
    SET gen_booking_id = LAST_INSERT_ID();
    
    UPDATE train_bookings SET reference_no = CONCAT('TV',(SELECT corporate_code FROM corporates WHERE id = corporate_id),gen_booking_id) WHERE id = gen_booking_id;
    
    INSERT INTO train_bookings_action_log(booking_id,action,action_date,user_id,user_type) VALUES(gen_booking_id,1,NOW(),user_id,login_type);
    
iterator:
LOOP
  IF LENGTH(TRIM(employees)) = 0 OR employees IS NULL THEN
    LEAVE iterator;
  END IF;
  SET _next = SUBSTRING_INDEX(employees,',',1);
  SET _nextlen = LENGTH(_next);
  SET _value = TRIM(_next);

  INSERT INTO employee_train_booking (train_booking_id,employee_id) VALUES (gen_booking_id,_value);
  SET employees = INSERT(employees,1,_nextlen + 1,'');
END LOOP;
    
    
    IF login_type = 10 THEN
    
  UPDATE train_bookings SET status_client=7,status_cotrav=1 WHERE id = gen_booking_id;
    
    ELSE
    
    IF(SELECT has_auth_level from corporates where id = corporate_id) = 1 THEN
IF (SELECT no_of_auth_level from corporates where id = corporate_id) = 1 THEN
    UPDATE train_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
    ELSE
     UPDATE train_bookings SET status_client=1,status_cotrav=1 WHERE id = gen_booking_id;
    END IF;
ELSE
UPDATE train_bookings SET status_client=7,status_cotrav=1 WHERE id = gen_booking_id;
SELECT * FROM corporates WHERE id = 0;
END IF;

END IF;

    COMMIT;
END ;;
