CREATE DEFINER=`root`@`localhost` PROCEDURE `corporateAgentsHomePage`()
    NO SQL
BEGIN
	DECLARE taxi_booking_count, taxi_invoice_count, un_taxi_booking_count INT;
	
	DECLARE bus_booking_count, bus_invoice_count, un_bus_booking_count  INT;
	
	DECLARE train_booking_count, train_invoice_count, un_train_booking_count INT;
	
	DECLARE hotel_booking_count, hotel_invoice_count, un_hotel_booking_count INT;
	
	DECLARE flight_booking_count, flight_invoice_count, un_flight_booking_count INT;
	
	DECLARE taxi_invoice_amount, taxi_unbilled_amount, taxi_unpaid_amount, taxi_billed_amount, bus_invoice_amount, bus_unbilled_amount, bus_unpaid_amount, bus_billed_amount, train_invoice_amount, train_unbilled_amount, train_unpaid_amount, train_billed_amount, hotel_invoice_amount, hotel_unbilled_amount, hotel_unpaid_amount, hotel_billed_amount, flight_unbilled_amount, flight_unpaid_amount, flight_billed_amount DOUBLE;
	
	DECLARE curr_dt DATETIME;
	DECLARE curr_year, last_year, next_year YEAR;
	DECLARE from_date,to_date,fyear varchar(20);
	
	SET curr_dt = (SELECT NOW());
	SET curr_year = YEAR(curr_dt);
	SET last_year = YEAR(curr_dt) -1;
	SET next_year = YEAR(curr_dt) +1;
	
	IF MONTH(curr_dt) in (4,5,6,7,8,9,10,11,12)
	THEN
		SET from_date = CONCAT(curr_year,'-04-01');
		SET to_date = now();
		SET fyear = CONCAT(curr_year,'-',next_year);
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(last_year,'-04-01');
		SET to_date = now();
		SET fyear = CONCAT(last_year,'-',curr_year);
	END IF;
	
	SET taxi_booking_count = (SELECT count(id) from taxi_bookings where status_cotrav >= 1);
	
	SELECT count(id) from taxi_bookings where status_cotrav = 1 and is_invoice=0 INTO un_taxi_booking_count;
    
    SET bus_booking_count = (SELECT count(id) from bus_bookings where status_cotrav >= 1);
	
	SELECT count(id) from bus_bookings where status_cotrav = 1 and is_invoice=0 INTO un_bus_booking_count;
    
    SET train_booking_count = (SELECT count(id) from train_bookings where status_cotrav >= 1);
	
	SELECT count(id) from train_bookings where status_cotrav = 1 and is_invoice=0 INTO un_train_booking_count;
    
    SET hotel_booking_count = (SELECT count(id) from hotel_bookings where status_cotrav >= 1);
	
	SELECT count(id) from hotel_bookings where status_cotrav = 1 and is_invoice=0 INTO un_hotel_booking_count;
    
    SET flight_booking_count = (SELECT count(id) from flight_bookings where status_cotrav >= 1);
	
	SELECT count(id) from flight_bookings where status_cotrav = 1 and is_invoice=0 INTO un_flight_booking_count;
	
	
				
	SELECT taxi_booking_count, taxi_invoice_count, taxi_invoice_amount, un_taxi_booking_count, bus_booking_count, bus_invoice_count, bus_invoice_amount, un_bus_booking_count, train_booking_count, train_invoice_count, train_invoice_amount, un_train_booking_count, hotel_booking_count, hotel_invoice_count, hotel_invoice_amount, un_hotel_booking_count, hotel_unbilled_amount, hotel_billed_amount, hotel_unpaid_amount, train_unbilled_amount, train_billed_amount, train_unpaid_amount, bus_unbilled_amount, bus_billed_amount, bus_unpaid_amount, taxi_unbilled_amount, taxi_billed_amount, taxi_unpaid_amount, un_flight_booking_count, flight_unbilled_amount, flight_billed_amount, flight_unpaid_amount, fyear;
END ;;
DELIMITER ;
