where b.status_cotrav IN(1,2,4) AND b.status_client IN(1,3,5,7) AND b.spoc_id=spoc_id AND DATE_SUB(NOW(), INTERVAL 2 HOUR) > b.pickup_from_datetime order by b.boarding_datetime;

END CASE;
   

END ;;
