CREATE DEFINER=`root`@`localhost` PROCEDURE `getLoginDetails`(IN `user_name` VARCHAR(100), IN `user_type` VARCHAR(50))
    NO SQL
BEGIN

IF user_type = 10 THEN
	SELECT ca.* from corporate_agents ca WHERE ca.email = user_name LIMIT 1;
    
        ELSEIF user_type = 1 THEN
    SELECT cl.* from corporate_logins cl WHERE cl.email = user_name LIMIT 1;
    
    ELSEIF user_type = 2 THEN
    SELECT ga.* from corporate_subgroup_authenticater ga WHERE ga.email = user_name LIMIT 1;
    
        ELSEIF user_type = 3 THEN
    SELECT ca.* from corporate_group_authenticator ca WHERE ca.email = user_name LIMIT 1;
    
        ELSEIF user_type = 4 THEN
    SELECT ca.* from corporate_spocs ca WHERE ca.username = user_name LIMIT 1;
    
    ELSEIF user_type = 6 THEN
SELECT ca.* from corporate_employees ca WHERE ca.username = user_name LIMIT 1;
    
END IF;
END ;;
