CREATE DEFINER=`root`@`localhost` PROCEDURE `spocHomePage`(IN `spoc_id` INT)
BEGIN
DECLARE total_active_users INT;
DECLARE total_bookings_count, taxi_bookings_count, bus_bookings_count, train_bookings_count, hotel_bookings_count, flight_bookings_count INT; 
DECLARE uc_total_bookings_count, uc_taxi_bookings_count, uc_bus_bookings_count, uc_train_bookings_count, uc_hotel_bookings_count, uc_flight_bookings_count INT; 
DECLARE tom_total_bookings_count, tom_taxi_bookings_count, tom_bus_bookings_count, tom_train_bookings_count, tom_hotel_bookings_count, tom_flight_bookings_count INT; 
DECLARE pa_total_bookings_count, pa_taxi_bookings_count, pa_bus_bookings_count, pa_train_bookings_count, pa_hotel_bookings_count, pa_flight_bookings_count INT; 
DECLARE pi_total_bookings_count, pi_taxi_bookings_count, pi_bus_bookings_count, pi_train_bookings_count, pi_hotel_bookings_count, pi_flight_bookings_count INT; 
DECLARE taxi_invoice_amount, bus_invoice_amount, train_invoice_amount, hotel_invoice_amount, flight_invoice_amount, total_invoice_amount DOUBLE DEFAULT 0.0;

DECLARE bucket_0_count,bucket_1_count,bucket_2_count,bucket_3_count,bucket_4_count INT DEFAULT 0; 

DECLARE curr_dt DATETIME;
DECLARE qrt,from_date,to_date varchar(20);

DECLARE bucket_count,bDone INT;
   DECLARE i INT DEFAULT 0;
   
   DECLARE curs CURSOR FOR SELECT count(id) FROM hotel_bookings b WHERE b.spoc_id = spoc_id and b.status_cotrav = 4 group by assign_room_type order by assign_room_type;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET bDone = 1;

SET curr_dt = (SELECT NOW());

IF MONTH(curr_dt) in (4,5,6)
THEN
SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;

SET total_active_users = (SELECT COUNT(id) FROM corporate_employees p where p.is_active = 1 and p.spoc_id = spoc_id);


   SET taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` WHERE b.spoc_id = spoc_id);
   SET bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` WHERE b.spoc_id = spoc_id);
   SET train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` WHERE b.spoc_id = spoc_id);
   SET hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` WHERE b.spoc_id = spoc_id);
   SET flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` WHERE b.spoc_id = spoc_id);
   SET total_bookings_count = taxi_bookings_count + bus_bookings_count + train_bookings_count + hotel_bookings_count + flight_bookings_count;
   
   
   SET uc_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings b WHERE b.spoc_id = spoc_id and b.pickup_datetime > now()  and b.status_cotrav IN(1,2,4));
   SET uc_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (b.pickup_from_datetime > DATE_SUB(now(), INTERVAL 24 HOUR) OR b.pickup_to_datetime > now()));
   SET uc_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (b.pickup_from_datetime > DATE_SUB(now(), INTERVAL 24 HOUR) OR b.pickup_to_datetime > now()));
   SET uc_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (b.checkin_datetime > now()));
   SET uc_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and b.departure_datetime > now());
   SET uc_total_bookings_count = uc_taxi_bookings_count + uc_bus_bookings_count + uc_train_bookings_count + uc_hotel_bookings_count + uc_flight_bookings_count;
   
   
   SET tom_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (DATE(b.pickup_datetime) between CURDATE() and (CURDATE() + INTERVAL 1 DAY)));
   SET tom_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (DATE(b.pickup_from_datetime) between CURDATE() and (CURDATE() + INTERVAL 1 DAY)));
   SET tom_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (DATE(b.pickup_from_datetime) between CURDATE() and (CURDATE() + INTERVAL 1 DAY)));
   SET tom_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (DATE(b.checkin_datetime) between CURDATE() and (CURDATE() + INTERVAL 1 DAY)));
   SET tom_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4) and (DATE(b.departure_datetime) between CURDATE() and (CURDATE() + INTERVAL 1 DAY)));
   SET tom_total_bookings_count = tom_taxi_bookings_count + tom_bus_bookings_count + tom_train_bookings_count + tom_hotel_bookings_count + tom_flight_bookings_count;
   
   
   SET pa_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4));
   SET pa_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4));
   SET pa_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4));
   SET pa_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4));
   SET pa_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` WHERE b.spoc_id = spoc_id and b.status_cotrav IN(1,2,4));
   SET pa_total_bookings_count = pa_taxi_bookings_count + pa_bus_bookings_count + pa_train_bookings_count + pa_hotel_bookings_count + pa_flight_bookings_count;
   
   
   SET pi_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join taxi_booking_client_invoice `i` on b.invoice_id = i.id WHERE b.spoc_id = spoc_id and b.is_invoice = 1 and i.status = 2);
   SET pi_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` left join taxi_booking_client_invoice `i` on b.invoice_id = i.id WHERE b.spoc_id = spoc_id and b.is_invoice = 1 and i.status = 2);
   SET pi_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join train_booking_client_invoice `i` on b.invoice_id = i.id WHERE b.spoc_id = spoc_id and b.is_invoice = 1 and i.status = 2);
   SET pi_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join hotel_booking_client_invoice `i` on b.invoice_id = i.id WHERE b.spoc_id = spoc_id and b.is_invoice = 1 and i.status = 2);
   SET pi_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join flight_booking_client_invoice `i` on b.invoice_id = i.id WHERE b.spoc_id = spoc_id and b.is_invoice = 1 and i.status = 2);
   SET pi_total_bookings_count = pi_taxi_bookings_count + pi_bus_bookings_count + pi_train_bookings_count + pi_hotel_bookings_count + pi_flight_bookings_count;
   
   
   SET taxi_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM taxi_booking_client_invoice WHERE booking_id in (select b.id from taxi_bookings `b` where b.spoc_id = spoc_id));
   SET bus_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM taxi_booking_client_invoice WHERE booking_id in (select id from bus_bookings `b` where b.spoc_id = spoc_id));
   SET train_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM train_booking_client_invoice WHERE booking_id in (select id from train_bookings `b` where b.spoc_id = spoc_id));
   SET hotel_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM hotel_booking_client_invoice WHERE booking_id in (select id from hotel_bookings `b` where b.spoc_id = spoc_id));
   SET flight_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM flight_booking_client_invoice WHERE booking_id in (select id from flight_bookings `b` where b.spoc_id = spoc_id));
   SET total_invoice_amount = taxi_invoice_amount + bus_invoice_amount + train_invoice_amount + hotel_invoice_amount + flight_invoice_amount;
   
   
   

   OPEN curs;
   SET bDone = 0;
   SET i=0;
REPEAT
    FETCH curs INTO bucket_count;
    IF i=0 THEN
    SET bucket_0_count = bucket_count;
    ELSEIF i=1 THEN
    SET bucket_1_count = bucket_count;
    ELSEIF i=2 THEN
    SET bucket_2_count = bucket_count;
    ELSEIF i=3 THEN
    SET bucket_3_count = bucket_count;
    ELSEIF i=4 THEN
    SET bucket_4_count = bucket_count;
    END IF;
    
    SET i = i+1;
   UNTIL bDone END REPEAT;

   CLOSE curs;
   

   SELECT total_active_users,total_bookings_count,taxi_bookings_count,bus_bookings_count,train_bookings_count,hotel_bookings_count,flight_bookings_count,uc_total_bookings_count,uc_taxi_bookings_count,uc_bus_bookings_count,uc_train_bookings_count,uc_hotel_bookings_count,uc_flight_bookings_count,tom_total_bookings_count,tom_taxi_bookings_count,tom_bus_bookings_count,tom_train_bookings_count,tom_hotel_bookings_count,tom_flight_bookings_count,pa_total_bookings_count,pa_taxi_bookings_count,pa_bus_bookings_count,pa_train_bookings_count,pa_hotel_bookings_count,pa_flight_bookings_count,pi_total_bookings_count,pi_taxi_bookings_count,pi_bus_bookings_count,pi_train_bookings_count,pi_hotel_bookings_count,pi_flight_bookings_count,bucket_0_count,bucket_1_count,bucket_2_count,bucket_3_count,bucket_4_count,taxi_invoice_amount,bus_invoice_amount,train_invoice_amount,hotel_invoice_amount,flight_invoice_amount,total_invoice_amount;

END ;;
DELIMITER ;
