	SELECT b.*,DATE_FORMAT(b.departure_datetime, '%d-%m-%Y %H:%i') as departure_datetime,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,ca.user_name cotrav_agent_name
