CREATE DEFINER=`root`@`localhost` PROCEDURE `viewTaxiBooking`(IN `booking_id` INT)
    NO SQL
BEGIN

SELECT b.*,DATE_FORMAT(b.pickup_datetime, '%d-%m-%Y %H:%i') as pickup_datetime,DATE_FORMAT(b.booking_date, '%d-%m-%Y %H:%i') as booking_date, tt.name `taxi_type_name`,c.name `city_name`,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,spoc.email, opr.operator_name, opr.operator_contact,ca.user_name cotrav_agent_name,cr.package_name,cr.base_rate,od.driver_name,od.driver_contact,od.licence_no,od.driver_email,tm.brand_name,tm.model_name,t.taxi_reg_no,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id
	from taxi_bookings `b`
	left join taxi_types `tt` on b.taxi_id = tt.id
    left join cities `c` on b.city_id = c.id
    left join status_client `sc` on b.status_client = sc.id
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join operators `opr` on b.operator_id = opr.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN corporate_rates cr ON b.rate_id = cr.id
    LEFT JOIN operator_drivers od ON b.driver_id = od.id
    LEFT JOIN taxis t ON b.taxi_id = t.id
    LEFT JOIN taxi_models tm ON t.taxi_model_id = tm.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id

    WHERE b.id = booking_id;

END ;;
